    data: |
      SELECT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT ( + + col1 ) * - col2 * 76 BETWEEN ( col2 ) AND NULL;
  - name: tab1

outputs:
  - name: q5928.out
    data: |
      59
      68
      96
